function TcpReturn() {
    this.code = 0;
    this.data = null; /*Buffer*/
    this.transfer_key = 0;
}

TcpReturn.prototype.toString = function () {
    return "TcpReturn [code=" + this.code + ", transfer_key=" + this.transfer_key + ", data="
        + (this.data != null ? this.data.toString('hex') : null) + "]";
};

module.exports = TcpReturn;